import axios from 'axios'
import React,{useState} from 'react'

const StockHome = () => {
    const [Input, setInput] = useState()

    const changeHandler =(event)=> {
        setInput({
            ...Input,
            [event.target.name]:event.target.value
        })
    }
    const submitHandler=e=>{
        e.preventDefault();
        axios.post(`http://localhost:5000/`,{Input})
        .then(response=>{
            console.log(response);
        }).catch(err=>{
            console.log(err);
        })
    }

    return (
        <div>
        <form onSubmit={submitHandler}>
            <div><input type="text" name="name" onChange={changeHandler} id="name"/></div>
            <div><input type="email" name="email" onChange={changeHandler} id="email"/></div>
            <div><input type="password" name="password" onChange={changeHandler} id="password"/></div>
            <button type="submit"> submit</button>
            </form>
        </div>
    )
}

export default StockHome
